import React from 'react';
import PropTypes from 'prop-types';

function ExerciseChart({ patientId, data, viewMode = 'patient', isExpanded = false }) {
  const exerciseData = data?.exerciseData || [];

  if (!exerciseData.length) {
    return (
      <div className="chart-placeholder">
        <p>No exercise data available for {patientId}</p>
      </div>
    );
  }

  return (
    <div className="exercise-chart">
      <div className="chart-content" style={{ height: isExpanded ? 450 : 300 }}>
        <p>Exercise Chart - {exerciseData.length} activities recorded</p>
        <p>Chart implementation coming soon...</p>
      </div>
    </div>
  );
}

ExerciseChart.propTypes = {
  patientId: PropTypes.string.isRequired,
  data: PropTypes.object.isRequired,
  viewMode: PropTypes.oneOf(['patient', 'physician']),
  isExpanded: PropTypes.bool
};

export default ExerciseChart;
